import { useEffect } from 'react';
import Nav from './components/Nav';
import './style/App.css';


function App() {


  const getData = async() => {
  let users = await fetch('/rest/users');
  users = await users.json();

  console.log(users);
}

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="App">
        <Nav />
      </div>
  );
}

export default App;
